import React from "react";
import "../stylesheet/CharacterCard.scss";

const CharacterCard = props => {
  return (
    <li className="card">
      <a href="#hola">
      <img className="card-img" src={props.item.image} alt="Character" 
      title={`Foto de ${props.item.namne}`}></img>
      <div className="cards_text">
      <h4 className="card_title">{props.item.name}</h4>
      <p className="card_name">{props.item.species}</p>
      </div>
      </a>
    </li>
  );
};

export default CharacterCard;
